from enum import Enum


class Song:
    def __init__(self, notes, durations, name):
        self.name = name
        _notes, _durations = [], []
        for n, dur in zip(notes, durations):
            if n == 0 and dur == 0:
                continue
            _notes.append(n)
            _durations.append(max(dur, 4) if n > 0 else dur)
        durations = [min(x, 255) for x in _durations]
        self.notes = _notes
        self.durations = _durations


